.container {
  overflow: hidden;
  outline: none;
  display: inline-block;
  white-space: nowrap;
  position: relative;
  background-color: #fff;
}
.container > *:not(ul) {
  height: 100%;
  display: flex;
  align-items: center;
}
.border {
  border-style: solid;
  border-width: 1px;
}

/* 搜索图标 */
.search_icon {
  float: left;
  font-size: 16px;
  padding-left: 6px;
}
/* 输入框 */
.input {
  height: 100%;
  width: 100%;
  display: inline-block;
  border: 0;
  outline: 0;
  padding: 0 8px;
}
.input::placeholder {
  color: #B0B0B0;
}
.input::-webkit-input-placeholder {
  color: #B0B0B0;
}
.input:-ms-input-placeholder {
  color: #B0B0B0;
}
.input::-ms-input-placeholder {
  color: #B0B0B0;
}
/* 清空按钮 */
.clear {
  float: right;
  position: relative;
  width: 0px;
}
.clear > i {
  position: absolute;
  cursor: pointer;
  left: -20px;
  width: 20px;
  font-size: 16px;
  line-height: 0;
}
.clear > i:first-child {
  top: 0;
  background-color: #fff;
  height: calc(100% - 2px);
}
/* 下拉容器 */
.dropdown {
  position: fixed;
  padding: 0;
  margin: 0;
  background-color: #fff;
  margin-block-start: 0;
  border-width: 1px;
  border-style: solid;
  border-top-width: 0;
  box-shadow: 0px 0px 5px 0px RGBA(0, 0, 0, 0.2);
}
.option_item {
  height: 30px;
  cursor: default;
  overflow: hidden;
  text-overflow: ellipsis;
}
.option_item:hover {
  background-color: #FCF0C1 !important;
}
